g: content-box; // 1\n  height: 0; // 1\n  overflow: visible; // 2\n}\n\n//\n// 1. Correct the inheritance and scaling of font size in all browsers.\n// 2. Correct the odd `em` font sizing in all browsers.\n//\n\npre {\n  font-family: monospace, monospace; // 1\n  font-size: 1em; // 2\n}\n\n// Text-level semantics\n// ==========================================================================\n\n//\n// 1. Remove the gray background on active links in IE 10.\n// 2. Remove gaps in links underline in iOS 8+ and Safari 8+.\n//\n\na {\n  background-color: transparent; // 1\n  -webkit-text-decoration-skip: objects; // 2\n}\n\n//\n// Remove the outline on focused links when they are also active or hovered\n// in all browsers (opinionated).\n//\n\na:active,\na:hover {\n  outline-width: 0;\n}\n\n//\n// 1. Remove the bottom border in Firefox 39-.\n// 2. Add the correct text decoration in Chrome, Edge, IE, Opera, and Safari.\n//\n\nabbr[title] {\n  border-bottom: none; // 1\n  text-decoration: underline; // 2\n  text-decoration: underline dotted; // 2\n}\n\n//\n// Prevent the duplicate application of `bolder` by the next rule in Safari 6.\n//\n\nb,\nstrong {\n  font-weight: inherit;\n}\n\n//\n// Add the correct font weight in Chrome, Edge, and Safari.\n//\n\nb,\nstrong {\n  font-weight: bolder;\n}\n\n//\n// 1. Correct the inheritance and scaling of font size in all browsers.\n// 2. Correct the odd `em` font sizing in all browsers.\n//\n\ncode,\nkbd,\nsamp {\n  font-family: monospace, monospace; // 1\n  font-size: 1em; // 2\n}\n\n//\n// Add the correct font style in Android 4.3-.\n//\n\ndfn {\n  font-style: italic;\n}\n\n//\n// Add the correct background and color in IE 9-.\n//\n\nmark {\n  background-color: #ff0;\n  color: #000;\n}\n\n//\n// Add the correct font size in all browsers.\n//\n\nsmall {\n  font-size: 80%;\n}\n\n//\n// Prevent `sub` and `sup` elements from affecting the line height in\n// all browsers.\n//\n\nsub,\nsup {\n  font-size: 75%;\n  line-height: 0;\n  position: relative;\n  vertical-align: baseline;\n}\n\nsub {\n  bottom: -0.25em;\n}\n\nsup {\n  top: -0.5em;\n}\n\n// Embedded content\n// ==========================================================================\n\n//\n// Add the correct display in IE 9-.\n//\n\naudio,\nvideo {\n  display: inline-block;\n}\n\n//\n// Add the correct display in iOS 4-7.\n//\n\naudio:not([controls]) {\n  display: none;\n  height: 0;\n}\n\n//\n// Remove the border on images inside links in IE 10-.\n//\n\nimg {\n  border-style: none;\n}\n\n//\n// Hide the overflow in IE.\n//\n\nsvg:not(:root) {\n  overflow: hidden;\n}\n\n// Forms\n// ==========================================================================\n\n//\n// 1. Change the font styles in all browsers (opinionated).\n// 2. Remove the margin in Firefox and Safari.\n//\n\nbutton,\ninput,\noptgroup,\nselect,\ntextarea {\n  font-family: sans-serif; // 1\n  font-size: 100%; // 1\n  line-height: 1.15; // 1\n  margin: 0; // 2\n}\n\n//\n// Show the overflow in IE.\n// 1. Show the overflow in Edge.\n//\n\nbutton,\ninput { // 1\n  overflow: visible;\n}\n\n//\n// Remove the inheritance of text transform in Edge, Firefox, and IE.\n// 1. Remove the inheritance of text transform in Firefox.\n//\n\nbutton,\nselect { // 1\n  text-transform: none;\n}\n\n//\n// 1. Prevent a WebKit bug where (2) destroys native `audio` and `video`\n//    controls in Android 4.\n// 2. Correct the inability to style clickable types in iOS and Safari.\n//\n\nbutton,\nhtml [type=\"button\"], // 1\n[type=\"reset\"],\n[type=\"submit\"] {\n  -webkit-appearance: button; // 2\n}\n\n//\n// Remove the inner border and padding in Firefox.\n//\n\nbutton::-moz-focus-inner,\n[type=\"button\"]::-moz-focus-inner,\n[type=\"reset\"]::-moz-focus-inner,\n[type=\"submit\"]::-moz-focus-inner {\n  border-style: none;\n  padding: 0;\n}\n\n//\n// Restore the focus styles unset by the previous rule.\n//\n\nbutton:-moz-focusring,\n[type=\"button\"]:-moz-focusring,\n[type=\"reset\"]:-moz-focusring,\n[type=\"submit\"]:-moz-focusring {\n  outline: 1px dotted ButtonText;\n}\n\n//\n// Change the border, margin, and padding in all browsers (opinionated).\n//\n\nfieldset {\n  border: 1px solid #c0c0c0;\n  margin: 0 2px;\n  padding: 0.35em 0.625em 0.75em;\n}\n\n//\n// 1. Correct the text wrapping in Edge and IE.\n// 2. Correct the color inheritance from `fieldset` elements in IE.\n// 3. Remove the padding so developers are not caught out when they zero out\n//    `fieldset` elements in all browsers.\n//\n\nlegend {\n  box-sizing: border-box; // 1\n  color: inherit; // 2\n  display: table; // 1\n  max-width: 100%; // 1\n  padding: 0; // 3\n  white-space: normal; // 1\n}\n\n//\n// 1. Add the correct display in IE 9-.\n// 2. Add the correct vertical alignment in Chrome, Firefox, and Opera.\n//\n\nprogress {\n  display: inline-block; // 1\n  vertical-align: baseline; // 2\n}\n\n//\n// Remove the default vertical scrollbar in IE.\n//\n\ntextarea {\n  overflow: auto;\n}\n\n//\n// 1. Add the correct box sizing in IE 10-.\n// 2. Remove the padding in IE 10-.\n//\n\n[type=\"checkbox\"],\n[type=\"radio\"] {\n  box-sizing: border-box; // 1\n  padding: 0; // 2\n}\n\n//\n// Correct the cursor style of increment and decrement buttons in Chrome.\n//\n\n[type=\"number\"]::-webkit-inner-spin-button,\n[type=\"number\"]::-webkit-outer-spin-button {\n  height: auto;\n}\n\n//\n// 1. Correct the odd appearance in Chrome and Safari.\n// 2. Correct the outline style in Safari.\n//\n\n[type=\"search\"] {\n  -webkit-appearance: textfield; // 1\n  outline-offset: -2px; // 2\n}\n\n//\n// Remove the inner padding and cancel buttons in Chrome and Safari on macOS.\n//\n\n[type=\"search\"]::-webkit-search-cancel-button,\n[type=\"search\"]::-webkit-search-decoration {\n  -webkit-appearance: none;\n}\n\n//\n// 1. Correct the inability to style clickable types in iOS and Safari.\n// 2. Change font properties to `inherit` in Safari.\n//\n\n::-webkit-file-upload-button {\n  -webkit-appearance: button; // 1\n  font: inherit; // 2\n}\n\n// Interactive\n// ==========================================================================\n\n//\n// Add the correct display in IE 9-.\n// 1. Add the correct display in Edge, IE, and Firefox.\n//\n\ndetails, // 1\nmenu {\n  display: block;\n}\n\n//\n// Add the correct display in all browsers.\n//\n\nsummary {\n  display: list-item;\n}\n\n// Scripting\n// ==========================================================================\n\n//\n// Add the correct display in IE 9-.\n//\n\ncanvas {\n  display: inline-block;\n}\n\n//\n// Add the correct display in IE.\n//\n\ntemplate {\n  display: none;\n}\n\n// Hidden\n// ==========================================================================\n\n//\n// Add the correct display in IE 10-.\n//\n\n[hidden] {\n  display: none;\n}\n","// scss-lint:disable QualifyingElement\n\n// Source: https://github.com/h5bp/html5-boilerplate/blob/master/src/css/main.css\n\n// ==========================================================================\n// Print styles.\n// Inlined to avoid the additional HTTP request:\n// http://www.phpied.com/delay-loading-your-print-css/\n// ==========================================================================\n\n@if $enable-print-styles {\n  @media print {\n    *,\n    *::before,\n    *::after,\n    p::first-letter,\n    div::first-letter,\n    blockquote::first-letter,\n    li::first-letter,\n    p::first-line,\n    div::first-line,\n    blockquote::first-line,\n    li::first-line {\n      // Bootstrap specific; comment out `color` and `background`\n      //color: #000 !important; // Black prints faster:\n                                //   http://www.sanbeiji.com/archives/953\n      text-shadow: none !important;\n      //background: transparent !important;\n      box-shadow: none !important;\n    }\n\n    a,\n    a:visited {\n      text-decoration: underline;\n    }\n\n    // Bootstrap specific; comment the following selector out\n    //a[href]::after {\n    //  content: \" (\" attr(href) \")\";\n    //}\n\n    abbr[title]::after {\n      content: \" (\" attr(title) \")\";\n    }\n\n    // Bootstrap specific; comment the following selector out\n    //\n    // Don't show links that are fragment identifiers,\n    // or use the `javascript:` pseudo protocol\n    //\n\n    //a[href^=\"#\"]::after,\n    //a[href^=\"javascript:\"]::after {\n    // content: \"\";\n    //}\n\n    pre {\n      white-space: pre-wrap !important;\n    }\n    pre,\n    blockquote {\n      border: $border-width solid #999;   // Bootstrap custom code; using `$border-width` instead of 1px\n      page-break-inside: avoid;\n    }\n\n    //\n    // Printing Tables:\n    // http://css-discuss.incutio.com/wiki/Printing_Tables\n    //\n\n    thead {\n      display: table-header-group;\n    }\n\n    tr,\n    img {\n      page-break-inside: avoid;\n    }\n\n    p,\n    h2,\n    h3 {\n      orphans: 3;\n      widows: 3;\n    }\n\n    h2,\n    h3 {\n      page-break-after: avoid;\n    }\n\n    // Bootstrap specific changes start\n\n    // Bootstrap components\n    .navbar {\n      display: none;\n    }\n    .badge {\n      border: $border-width solid #000;\n    }\n\n    .table {\n      border-collapse: collapse !important;\n\n      td,\n      th {\n        background-color: #fff !important;\n      }\n    }\n    .table-bordered {\n      th,\n      td {\n        border: 1px solid #ddd !important;\n      }\n    }\n\n    // Bootstrap specific changes end\n  }\n}\n","// scss-lint:disable QualifyingElement, DuplicateProperty\n\n// Reboot\n//\n// Global resets to common HTML elements and more for easier usage by Bootstrap.\n// Adds additional rules on top of Normalize.css, including several overrides.\n\n\n// Reset the box-sizing\n//\n// Change from `box-sizing: content-box` to `border-box` so that when you add\n// `padding` or `border`s to an element, the overall declared `width` does not\n// change. For example, `width: 100px;` will always be `100px` despite the\n// `border: 10px solid red;` and `padding: 20px;`.\n//\n// Heads up! This reset may cause conflicts with some third-party widgets. For\n// recommendations on resolving such conflicts, see\n// https://getbootstrap.com/getting-started/#third-box-sizing.\n//\n// Credit: https://css-tricks.com/inheriting-box-sizing-probably-slightly-better-best-practice/\n\nhtml {\n  box-sizing: border-box;\n}\n\n*,\n*::before,\n*::after {\n  box-sizing: inherit;\n}\n\n\n// Make viewport responsive\n//\n// @viewport is needed because IE 10+ doesn't honor <meta name=\"viewport\"> in\n// some cases. See https://timkadlec.com/2012/10/ie10-snap-mode-and-responsive-design/.\n// Eventually @viewport will replace <meta name=\"viewport\">.\n//\n// However, `device-width` is broken on IE 10 on Windows (Phone) 8,\n// (see https://timkadlec.com/2013/01/windows-phone-8-and-device-width/ and https://github.com/twbs/bootstrap/issues/10497)\n// and the fix for that involves a snippet of JavaScript to sniff the user agent\n// and apply some conditional CSS.\n//\n// See https://getbootstrap.com/getting-started/#support-ie10-width for the relevant hack.\n//\n// Wrap `@viewport` with `@at-root` for when folks do a nested import (e.g.,\n// `.class-name { @import \"bootstrap\"; }`).\n@at-root {\n  @-ms-viewport { width: device-width; }\n}\n\n\n//\n// Reset HTML, body, and more\n//\n\nhtml {\n  // We assume no initial pixel `font-size` for accessibility reasons. This\n  // allows web visitors to customize their browser default font-size, making\n  // your project more inclusive and accessible to everyone.\n\n  // As a side-effect of setting the @viewport above,\n  // IE11 & Edge make the scrollbar overlap the content and automatically hide itself when not in use.\n  // Unfortunately, the auto-showing of the scrollbar is sometimes too sensitive,\n  // thus making it hard to click on stuff near the right edge of the page.\n  // So we add this style to force IE11 & Edge to use a \"normal\", non-overlapping, non-auto-hiding scrollbar.\n  // See https://github.com/twbs/bootstrap/issues/18543\n  // and https://developer.microsoft.com/en-us/microsoft-edge/platform/issues/7165383/\n  -ms-overflow-style: scrollbar;\n\n  // Changes the default tap highlight to be completely transparent in iOS.\n  -webkit-tap-highlight-color: rgba(0,0,0,0);\n}\n\nbody {\n  font-family: $font-family-base;\n  font-size: $font-size-base;\n  font-weight: $font-weight-base;\n  line-height: $line-height-base;\n  // Go easy on the eyes and use something other than `#000` for text\n  color: $body-color;\n  // By default, `<body>` has no `background-color` so we set one as a best practice.\n  background-color: $body-bg;\n}\n\n// Suppress the focus outline on elements that cannot be accessed via keyboard.\n// This prevents an unwanted focus outline from appearing around elements that\n// might still respond to pointer events.\n//\n// Credit: https://github.com/suitcss/base\n[tabindex=\"-1\"]:focus {\n  outline: none !important;\n}\n\n\n//\n// Typography\n//\n\n// Remove top margins from headings\n//\n// By default, `<h1>`-`<h6>` all receive top and bottom margins. We nuke the top\n// margin for easier control within type scales as it avoids margin collapsing.\nh1, h2, h3, h4, h5, h6 {\n  margin-top: 0;\n  margin-bottom: .5rem;\n}\n\n// Reset margins on paragraphs\n//\n// Similarly, the top margin on `<p>`s get reset. However, we also reset the\n// bottom margin to use `rem` units instead of `em`.\np {\n  margin-top: 0;\n  margin-bottom: 1rem;\n}\n\n// Abbreviations\nabbr[title],\n// Add data-* attribute to help out our tooltip plugin, per https://github.com/twbs/bootstrap/issues/5257\nabbr[data-original-title] {\n  cursor: help;\n}\n\naddress {\n  margin-bottom: 1rem;\n  font-style: normal;\n  line-height: inherit;\n}\n\nol,\nul,\ndl {\n  margin-top: 0;\n  margin-bottom: 1rem;\n}\n\nol ol,\nul ul,\nol ul,\nul ol {\n  margin-bottom: 0;\n}\n\ndt {\n  font-weight: $dt-font-weight;\n}\n\ndd {\n  margin-bottom: .5rem;\n  margin-left: 0; // Undo browser default\n}\n\nblockquote {\n  margin: 0 0 1rem;\n}\n\n\n//\n// Links\n//\n\na {\n  color: $link-color;\n  text-decoration: $link-decoration;\n\n  @include hover-focus {\n    color: $link-hover-color;\n    text-decoration: $link-hover-decoration;\n  }\n}\n\n// And undo these styles for placeholder links/named anchors (without href)\n// which have not been made explicitly keyboard-focusable (without tabindex).\n// It would be more straightforward to just use a[href] in previous block, but that\n// causes specificity issues in many other styles that are too complex to fix.\n// See https://github.com/twbs/bootstrap/issues/19402\n\na:not([href]):not([tabindex]) {\n  color: inherit;\n  text-decoration: none;\n\n  @include hover-focus {\n    color: inherit;\n    text-decoration: none;\n  }\n\n  &:focus {\n    outline: 0;\n  }\n}\n\n\n//\n// Code\n//\n\npre {\n  // Remove browser default top margin\n  margin-top: 0;\n  // Reset browser default of `1em` to use `rem`s\n  margin-bottom: 1rem;\n  // Normalize v4 removed this property, causing `<pre>` content to break out of wrapping code snippets\n  overflow: auto;\n}\n\n\n//\n// Figures\n//\n\nfigure {\n  // Normalize adds `margin` to `figure`s as browsers apply it inconsistently.\n  // We reset that to create a better flow in-page.\n  margin: 0 0 1rem;\n}\n\n\n//\n// Images\n//\n\nimg {\n  // By default, `<img>`s are `inline-block`. This assumes that, and vertically\n  // centers them. This won't apply should you reset them to `block` level.\n  vertical-align: middle;\n  // Note: `<img>`s are deliberately not made responsive by default.\n  // For the rationale behind this, see the comments on the `.img-fluid` class.\n}\n\n\n// iOS \"clickable elements\" fix for role=\"button\"\n//\n// Fixes \"clickability\" issue (and more generally, the firing of events such as focus as well)\n// for traditionally non-focusable elements with role=\"button\"\n// see https://developer.mozilla.org/en-US/docs/Web/Events/click#Safari_Mobile\n\n[role=\"button\"] {\n  cursor: pointer;\n}\n\n\n// Avoid 300ms click delay on touch devices that support the `touch-action` CSS property.\n//\n// In particular, unlike most other browsers, IE11+Edge on Windows 10 on touch devices and IE Mobile 10-11\n// DON'T remove the click delay when `<meta name=\"viewport\" content=\"width=device-width\">` is present.\n// However, they DO support removing the click delay via `touch-action: manipulation`.\n// See:\n// * https://v4-alpha.getbootstrap.com/content/reboot/#click-delay-optimization-for-touch\n// * http://caniuse.com/#feat=css-touch-action\n// * https://patrickhlauke.github.io/touch/tests/results/#suppressing-300ms-delay\n\na,\narea,\nbutton,\n[role=\"button\"],\ninput,\nlabel,\nselect,\nsummary,\ntextarea {\n  touch-action: manipulation;\n}\n\n\n//\n// Tables\n//\n\ntable {\n  // No longer part of Normalize since v4\n  border-collapse: collapse;\n  // Reset for nesting within parents with `background-color`.\n  background-color: $table-bg;\n}\n\ncaption {\n  padding-top: $table-cell-padding;\n  padding-bottom: $table-cell-padding;\n  color: $text-muted;\n  text-align: left;\n  caption-side: bottom;\n}\n\nth {\n  // Centered by default, but left-align-ed to match the `td`s below.\n  text-align: left;\n}\n\n\n//\n// Forms\n//\n\nlabel {\n  // Allow labels to use `margin` for spacing.\n  display: inline-block;\n  margin-bottom: .5rem;\n}\n\n// Work around a Firefox/IE bug where the transparent `button` background\n// results in a loss of the default `button` focus styles.\n//\n// Credit: https://github.com/suitcss/base/\nbutton:focus {\n  outline: 1px dotted;\n  outline: 5px auto -webkit-focus-ring-color;\n}\n\ninput,\nbutton,\nselect,\ntextarea {\n  // Normalize includes `font: inherit;`, so `font-family`. `font-size`, etc are\n  // properly inherited. However, `line-height` isn't inherited there.\n  line-height: inherit;\n}\n\ninput[type=\"radio\"],\ninput[type=\"checkbox\"] {\n  // Apply a disabled cursor for radios and checkboxes.\n  //\n  // Note: Neither radios nor checkboxes can be readonly.\n  &:disabled {\n    cursor: $cursor-disabled;\n  }\n}\n\n\ninput[type=\"date\"],\ninput[type=\"time\"],\ninput[type=\"datetime-local\"],\ninput[type=\"month\"] {\n  // Remove the default appearance of temporal inputs to avoid a Mobile Safari\n  // bug where setting a custom line-height prevents text from being vertically\n  // centered within the input.\n  // See https://bugs.webkit.org/show_bug.cgi?id=139848\n  // and https://github.com/twbs/bootstrap/issues/11266\n  -webkit-appearance: listbox;\n}\n\ntextarea {\n  // Textareas should really only resize vertically so they don't break their (horizontal) containers.\n  resize: vertical;\n}\n\nfieldset {\n  // Browsers set a default `min-width: min-content;` on fieldsets,\n  // unlike e.g. `<div>`s, which have `min-width: 0;` by default.\n  // So we reset that to ensure fieldsets behave more like a standard block element.\n  // See https://github.com/twbs/bootstrap/issues/12359\n  // and https://html.spec.whatwg.org/multipage/#the-fieldset-and-legend-elements\n  min-width: 0;\n  // Reset the default outline behavior of fieldsets so they don't affect page layout.\n  padding: 0;\n  margin: 0;\n  border: 0;\n}\n\nlegend {\n  // Reset the entire legend element to match the `fieldset`\n  display: block;\n  width: 100%;\n  padding: 0;\n  margin-bottom: .5rem;\n  font-size: 1.5rem;\n  line-height: inherit;\n}\n\ninput[type=\"search\"] {\n  // This overrides the extra rounded corners on search inputs in iOS so that our\n  // `.form-control` class can properly style them. Note that this cannot simply\n  // be added to `.form-control` as it's not specific enough. For details, see\n  // https://github.com/twbs/bootstrap/issues/11586.\n  -webkit-appearance: none;\n}\n\n// todo: needed?\noutput {\n  display: inline-block;\n//  font-size: $font-size-base;\n//  line-height: $line-height;\n//  color: $input-color;\n}\n\n// Always hide an element with the `hidden` HTML attribute (from PureCSS).\n[hidden] {\n  display: none !important;\n}\n","// Variables\n//\n// Copy settings from this file into the provided `_custom.scss` to override\n// the Bootstrap defaults without modifying key, versioned files.\n\n\n// Table of Contents\n//\n// Colors\n// Options\n// Spacing\n// Body\n// Links\n// Grid breakpoints\n// Grid containers\n// Grid columns\n// Fonts\n// Components\n// Tables\n// Buttons\n// Forms\n// Dropdowns\n// Z-index master list\n// Navbar\n// Navs\n// Pagination\n// Jumbotron\n// Form states and alerts\n// Cards\n// Tooltips\n// Popovers\n// Badges\n// Modals\n// Alerts\n// Progress bars\n// List group\n// Image thumbnails\n// Figures\n// Breadcrumbs\n// Carousel\n// Close\n// Code\n\n@mixin _assert-ascending($map, $map-name) {\n  $prev-key: null;\n  $prev-num: null;\n  @each $key, $num in $map {\n    @if $prev-num == null {\n      // Do nothing\n    } @else if not comparable($prev-num, $num) {\n      @warn \"Potentially invalid value for #{$map-name}: This map must be in ascending order, but key '#{$key}' has value #{$num} whose unit makes it incomparable to #{$prev-num}, the value of the previous key '#{$prev-key}' !\";\n    } @else if $prev-num >= $num {\n      @warn \"Invalid value for #{$map-name}: This map must be in ascending order, but key '#{$key}' has value #{$num} which isn't greater than #{$prev-num}, the value of the previous key '#{$prev-key}' !\";\n    }\n    $prev-key: $key;\n    $prev-num: $num;\n  }\n}\n\n// Replace `$search` with `$replace` in `$string`\n// @author Hugo Giraudel\n// @param {String} $string - Initial string\n// @param {String} $search - Substring to replace\n// @param {String} $replace ('') - New value\n// @return {String} - Updated string\n@function str-replace($string, $search, $replace: \"\") {\n  $index: str-index($string, $search);\n\n  @if $index {\n    @return str-slice($string, 1, $index - 1) + $replace + str-replace(str-slice($string, $index + str-length($search)), $search, $replace);\n  }\n\n  @return $string;\n}\n\n@mixin _assert-starts-at-zero($map) {\n  $values: map-values($map);\n  $first-value: nth($values, 1);\n  @if $first-value != 0 {\n    @warn \"First breakpoint in `$grid-breakpoints` must start at 0, but starts at #{$first-value}.\";\n  }\n}\n\n\n// General variable structure\n//\n// Variable format should follow the `$component-modifier-state-property` order.\n\n\n// Colors\n//\n// Grayscale and brand colors for use across Bootstrap.\n\n// Start with assigning color names to specific hex values.\n$white:  #fff !default;\n$black:  #000 !default;\n$red:    #d9534f !default;\n$orange: #f0ad4e !default;\n$yellow: #ffd500 !default;\n$green:  #5cb85c !default;\n$blue:   #0275d8 !default;\n$teal:   #5bc0de !default;\n$pink:   #ff5b77 !default;\n$purple: #613d7c !default;\n\n// Create grayscale\n$gray-dark:                 #292b2c !default;\n$gray:                      #464a4c !default;\n$gray-light:                #636c72 !default;\n$gray-lighter:              #eceeef !default;\n$gray-lightest:             #f7f7f9 !default;\n\n// Reassign color vars to semantic color scheme\n$brand-primary:             $blue !default;\n$brand-success:             $green !default;\n$brand-info:                $teal !default;\n$brand-warning:             $orange !default;\n$brand-danger:              $red !default;\n$brand-inverse:             $gray-dark !default;\n\n\n// Options\n//\n// Quickly modify global styling by enabling or disabling optional features.\n\n$enable-rounded:            true !default;\n$enable-shadows:            false !default;\n$enable-gradients:          false !default;\n$enable-transitions:        true !default;\n$enable-hover-media-query:  false !default;\n$enable-grid-classes:       true !default;\n$enable-print-styles:       true !default;\n\n\n// Spacing\n//\n// Control the default styling of most Bootstrap elements by modifying these\n// variables. Mostly focused on spacing.\n// 